import "./home.css";
import { motion } from "framer-motion";
import Avatar from "@mui/material/Avatar";
import Profil from "C:/Users/P1607/Desktop/blog/src/images/profil.jpg";
const Home = () => {
  return (
    <motion.div
      intial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      exit={{ opacity: 0 }}
    >
      <div className="">
        <Avatar sx={{ width: 150, height: 150 }} src={Profil} />
        <div className="profil-desc">
          Merhaba, 2019 yılında fotoğrafçılık işini bırakarak Detaysoft ailesine
          tasarımcı olarak başladım bu süreçte css,js,html,ui5 öğrenirken daha
          sonra web servisleri öğrenerek Fiori takımına geçiş yaptım bu sürede
          birçok projelere katkı sağlarken angular,react gibi frameworklerde
          projeler yaptım hobi olarak flutter ve node.js araştırması ve bireysel
          projeler yapıyorum.
        </div>
      </div>
    </motion.div>
  );
};
export default Home;
